function init_iconsax(){document.querySelectorAll(".iconsax").forEach(n=>{var t=n.getAttribute("data-icon").toLowerCase().trim();fetch("https://glenthemes.github.io/iconsax/icons/"+t+".svg").then(n=>n.text()).then(t=>{n.innerHTML=t,n.querySelectorAll("[http-equiv='Content-Security-Policy']").length&&(n.innerHTML="")})})}document.addEventListener("DOMContentLoaded",()=>{init_iconsax()});